import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Provider, Heading, Subhead } from "rebass";
import {
  Hero, CallToAction
} from 'react-landing-page'

export default class Home extends Component {
  render() {
    return (
      <Provider>
      <Hero
        color="black"
        bg="white"
        backgroundImage="https://art.pixilart.com/adb150f032eb730.png"
      >
        <Heading>Cheat Checker</Heading>
        <Subhead>Prevent Stack Exchange Plagiarism</Subhead>
        <Link to="/login" className="nav-link">Student Login</Link>
        <CallToAction href="/instructor" mt={3}>
          For Instructors
        </CallToAction>
      </Hero>
      </Provider>
    );
  }
}
